/*
 * Given a string s, find the length of the longest substring without repeating
 * characters.
 *
 * Example:
 *
 * Input: s = "abcabcbb"
 * Output: 3
 * Explanation: The answer is "abc", with the length of 3.
 *
 * 0 <= s.length <= 5 * 10^4
 *
 */

#include<string>
#include<set>
#include<array>
#include<algorithm>
#include<iostream>

using namespace std;

class Solution {
public:
	/*
	 * Runtime: 961 ms, faster than 5.06% of C++ online submissions for
	 * Longest Substring Without Repeating Characters.
	 *
	 * Memory Usage: 210.5 MB, less than 5.86% of C++ online submissions for
	 * Longest Substring Without Repeating Characters.
	*/

	/* Divide and conquer strategy
	 *
	 * The solution recombination's complexity is too high. O(n^2)
	 */
	int lengthOfLongestSubstring(string s) {
		string longuest = longestSubstring(s);
		return longuest.size();
	}

	string longestSubstring(string s) {
		string::size_type size = s.size();
		//cout << "longestSubstring(" << s << "<" << size << ">);" << endl;
		if (size <= 1) {
			return s;
		} else {
			// split into two subproblems
			string left = s.substr(0, size / 2);
			string right = s.substr(size / 2, size / 2 + size % 2);

			// compute the solution at the edge
			string left_edge = longestRightEdgeSubstring(left);
			string right_edge = longestLeftEdgeSubstring(right);

			string left_right = completeLeft(left_edge, right_edge);
			string right_left = completeRight(right_edge, left_edge);

			// solve the parts, only if the solution is not the
			// whole sub problem.
			string left_result = left_edge.size() == left.size() ? left_edge : longestSubstring(left);
			string right_result = right_edge.size() == right.size() ? right_edge : longestSubstring(right);

			//cout << "(left_edge, right_edge) = (" << left_edge << ", " << right_edge << ")" << endl;
			//cout << "left_right = " << left_right << endl;
			//cout << "right_left = " << right_left << endl;

			array<string, 4> candidates = {left_result, right_result, left_right, right_left};

			array<string, 4>::iterator result = max_element(candidates.begin(), candidates.end(),
					// compare on length
					[](const string &a, const string& b) -> bool { return a.size() < b.size(); });

			return *result;
		}
	}

	// computes the longest non repeating prefix
	// O(s.size())
	string longestLeftEdgeSubstring(string s) {
		set<char> seen;
		string result = "";
		for(
				string::iterator it = s.begin();
				// without c++20, just a bit slower
				//it != s.end() && seen.find(*it) == seen.end();
				it != s.end() && !seen.contains(*it);
				it++ ) {
			result.push_back(*it);
			seen.insert(*it);
		}
		return result;
	}

	// computes the longest non repeating sufix
	// O(s.size())
	string longestRightEdgeSubstring(string s) {
		set<char> seen;
		string result = "";
		for(
				string::reverse_iterator it = s.rbegin();
				// without c++20
				//it != s.rend() && seen.find(*it) == seen.end();
				it != s.rend() && !seen.contains(*it);
				it++ ) {
			// cons
			result.insert(0, 1, *it);
			seen.insert(*it);
		}
		return result;
	}

	// computes p ++ sufix, for p a sufix of s such that:
	// 	1. p ++ sufix, has unique elements
	// 	2. p ++ sufix, has the maximum size
	//
	// O(s.size() * sufix.size() * log(s.size))
	string completeLeft(string s, string sufix) {
		string result(s);
		string::size_type result_size = result.size();

		// O(N * log N)
		set<char> seen(result.begin(), result.end());
		for(
			string::iterator sit = s.begin();
			sit != s.end();
			sit++ ) {

			// get the substring starting at `sit`
			string candidate(sit, s.end());

			if (candidate.size() + sufix.size() < result_size) {
				break;
			}

			if (sit != s.begin()) {
				seen.erase(*(sit-1)); // O(amortized constant)
			}

			for(
				string::iterator it = sufix.begin();
				// without c++20
				//it != sufix.end() && seen.find(*it) == seen.end();
				it != sufix.end() && !seen.contains(*it); // O(log N)
				it ++ ) {
				candidate.push_back(*it);
			}

			string::size_type candidate_size = candidate.size();
			if (candidate_size > result_size) {
				result_size = candidate_size;
				result = candidate;
			}
		}

		return result;
	}

	// computes prefix ++ p , for p a prefix of s such that:
	// 	1. prefix ++ p, has unique elements
	// 	2. prefix ++ p, has the maximum size
	string completeRight(string s, string prefix) {
		//cout << "completeRight(" << s << ", " << prefix << ")" << endl;
		string result(s);
		string::size_type result_size = result.size();
		set<char> seen(result.begin(), result.end());
		for(
			string::reverse_iterator sit = s.rbegin();
			sit != s.rend();
			sit++ ) {

			// get the substring ending at `sit`
			string candidate(sit, s.rend());

			//cout << "pre candidate: " << candidate << endl;

			if (candidate.size() + prefix.size() < result_size) {
				break;
			}

			if (sit != s.rbegin()) {
				seen.erase(*(sit-1));
			}

			for(
				string::reverse_iterator it = prefix.rbegin();
				// without c++20
				//it != prefix.rend() && seen.find(*it) == seen.end();
				it != prefix.rend() && !seen.contains(*it);
				it ++ ) {
				candidate.push_back(*it);
			}

			//cout << "pos candidate: " << candidate << endl;

			string::size_type candidate_size = candidate.size();
			if (candidate_size > result_size) {
				result_size = candidate_size;
				result = candidate;
			}

		}

		std::reverse(result.begin(), result.end());
		//cout << "result: " << result << endl;

		return result;
	}
};

