	Solution sol;
	
	// "abc"
	cout << sol.longestSubstring("abcabcbb") << endl;

	// "kew"
	cout << sol.longestSubstring("pwwkew") << endl;

	// "vdf"
	cout << sol.longestSubstring("dvdf") << endl;

